import React from "react";

import Menu from "../components/Menu";

import 'bootstrap/dist/css/bootstrap.min.css';

function Login() {
    return (
        <div>
            <Menu />

            <div>
                <h1 className="login_title">Login</h1>
                <form onSubmit={ onSubmit }>
            <div></div>
                </form>
                
            </div>

             
        </div>
    );
}

export default Login;
